import React from 'react';

function Button(props){
	const logIn = "Log In";
	const logOut = "Log Out";
	return(
		<div>
			<button text={props.isLoggedIn ? logIn : logOut}
			 onClick={props.onClick}/>
		</div>
		);
}

export default Button;
